import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import {BrowserRouter as Router, Routers, Route} from 'react-router-dom'

ReactDOM.render(

  <Routers>
    <Routes>
      <Route path = '/' element = {<App/>} />
    </Routes>
  </Routers>,

  document.getElementById('root')
);
